      }
      .summary-grid {
        display: flex;
        flex-wrap: wrap;
        gap: 1rem;
      }
      .stat {
        background: #dfe6e9;
        border-radius: 6px;
        padding: 1rem;
        min-width: 130px;
        text-align: center;
        flex: 1;
      }
      .stat-warn {
        background: #ffeaa7;
      }
      .stat-info {
        background: #ffd093;
        color: #000000;
      }
      .stat-value {
        display: block;
        font-size: 1.5rem;
        font-weight: 700;
      }
      .stat-label {
        font-size: 0.8rem;
        text-transform: uppercase;
        letter-spacing: 0.05em;
        opacity: 0.7;
      }
      .table-wrap {
        width: 100%;
        overflow-x: auto;
        -webkit-overflow-scrolling: touch;
      }

      table {
        width: 100%;
        border-collapse: collapse;
        margin-top: 0.5rem;
      }
      th,
      td,
      code {
        overflow-wrap: anywhere;
        word-break: break-word;
        white-space: normal;
      }
      th,
      td {
        padding: 0.6rem 0.8rem;
        text-align: left;
        border-bottom: 1px solid #eee;
      }
      th {
        background: #f8f9fa;
        font-weight: 600;
        font-size: 0.85rem;
        text-transform: uppercase;
        letter-spacing: 0.03em;
      }
      code {
        background: #f1f2f6;
        padding: 0.15em 0.4em;
        border-radius: 3px;
        font-size: 0.9em;
      }
      .badge {
        display: inline-block;
        padding: 0.15em 0.6em;
        border-radius: 10px;
        font-size: 0.8rem;
        font-weight: 600;
      }

      .badge.ok {
        background: #00b894;
        color: #fff;
      }

      .badge.fail {
        background: #d63031;
        color: #fff;
      }

      ul {
        list-style: disc inside;
        margin-top: 0.5rem;
      }

      li {
        padding: 0.2rem 0;
      }

      small {
        color: #636e72;
      }
    </style>
  </head>
  <body>
    <div class="header">
      <span class="logo-koalesce"></span>
      <h1>Merge Report</h1>
      <div></div>
      <p class="timestamp">{{Timestamp}}</p>
    </div>

    <div class="container">
      <!-- Summary -->
      <section>
        <h2>Summary</h2>
        <div class="summary-grid">{{SummaryStats}}</div>
      </section>

      <!-- Sources -->
      <section>
        <h2>Sources</h2>
        <div class="table-wrap">
          <table>
            <thead>
              <tr>
                <th>Path</th>
                <th>Tag Prefix</th>
                <th>Virtual Prefix</th>
                <th>Status</th>
              </tr>
            </thead>
            <tbody>
              {{SourceRows}}
            </tbody>
          </table>
        </div>
      </section>

      {{ConflictsSection}} {{DeduplicationSection}} {{RemovalsSection}}
    </div>
  </body>
</html>
